    def minJumps(self, arr: List[int]) -> int:
        N = len(arr)
        graph = defaultdict(list)
        for i, v in enumerate(arr):
            graph[v] += [i]
        # Now do a BFS on graph edge list
        currList = list()
        visited = set()
        root, target = 0, N - 1
        step = 0
        currList.append(root)
        visited.add(root)
        while len(currList) > 0:
            print(f'\tstep, currList, visited = {step}, {currList}, {visited}')
            print(f'\tgraph = {graph}')
            print('====')
            nextList = list()
            for node in currList:
                if node == target:
                    return step
                x = arr[node]
                for child in graph[x]:
                    if child not in visited:
                        nextList.append(child)
                        visited.add(child)
                # Add the neighbors
                for child in [node-1, node+1]:
                    if 0 <= child < N and child not in visited:
                        nextList.append(child)
                        visited.add(child)
            graph[x].clear()
            currList = nextList
            step += 1
        return -1

